import {VoteComponent} from '../voteComponent/voteComponent';
export const HotelComponent = ({hotels})=>{
    console.log(hotels)
    return (
        <div>
            <ul>
                {hotels.map((hotel)=>{
                    <li key={hotel.id}>{hotel.name}</li>

                })}
            </ul>
            <VoteComponent services={hotels.services}/>
        </div>
    )
}
